import React from 'react';

function Header(){
    let title = "";
    const client = "Designer";

    const title_designer = "Design ";

    return(
        <div className="navbar bg-dark rounded">
        <h2 className="text-white">{client == "Designer" ? "Design " : "Programming "} is my life</h2>
        </div>
    );
}

export default Header;
